import Link from "next/link";

const FolderLink = (props = (
  <Link href={`?id=${props.id}`}>
    <a>Załatw sprawę</a>
  </Link>
));

const Navbar = () => {
  return (
    <div className="navbar-container">
      <div className="navbar-brand">
        <Link href="/">
          <a>Sprawa Dla Imigranta.pl</a>
        </Link>
      </div>
      <div className="navbar-nav">
        <Link href="/">
          <a>Strona główna</a>
        </Link>
        <FolderLink id="Cudzoziemcy" />
        <Link href="/#">
          <a>Wnioski</a>
        </Link>
        <Link href="/#">
          <a>Forum</a>
        </Link>
      </div>
    </div>
  );
};

export default Navbar;
